import React from 'react';
import { Link } from 'react-router-dom';

interface SavedCard {
  id: string;
  name: string;
  job: string;
  avatar: string;
  createdAt: string;
}

const Profile: React.FC = () => {
  // Временные данные для демонстрации
  const savedCards: SavedCard[] = [
    {
      id: '1',
      name: 'Эмма',
      job: 'Архитектор',
      avatar: 'https://via.placeholder.com/150',
      createdAt: '2024-04-18'
    },
    {
      id: '2',
      name: 'Алексей',
      job: 'Менеджер',
      avatar: 'https://via.placeholder.com/150',
      createdAt: '2024-04-17'
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-purple-100 to-white py-16">
      <div className="container mx-auto px-4">
        <div className="max-w-4xl mx-auto">
          <h1 className="text-3xl font-bold text-purple-900 mb-8">Мои персонажи</h1>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            {savedCards.map((card) => (
              <Link
                key={card.id}
                to={`/card/${card.id}`}
                className="bg-white rounded-lg shadow-lg overflow-hidden hover:shadow-xl transition-shadow"
              >
                <div className="p-6">
                  <div className="flex items-center mb-4">
                    <img
                      src={card.avatar}
                      alt={card.name}
                      className="w-16 h-16 rounded-full object-cover mr-4"
                    />
                    <div>
                      <h2 className="text-xl font-semibold text-purple-900">{card.name}</h2>
                      <p className="text-gray-600">{card.job}</p>
                    </div>
                  </div>
                  <p className="text-sm text-gray-500">
                    Создано: {new Date(card.createdAt).toLocaleDateString()}
                  </p>
                </div>
              </Link>
            ))}
          </div>

          <div className="mt-8 text-center">
            <Link
              to="/play"
              className="inline-block bg-purple-600 text-white px-6 py-3 rounded-full text-lg font-semibold hover:bg-purple-700 transition-colors"
            >
              Создать нового персонажа
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
